    private String expression;

    ExistsRule(String expression) {
        this.expression = expression;
    }

    public String getExpression() {
        return expression;
    }

    public Expression replace(Expression alpha, Expression e, Expression e1, Expression variable) {
        try {
            return new ArithmeticParser().parse(expression
                    .replace("1", alpha.asString().insert(0, "(").append(")"))
                    .replace("2", e.asString().insert(0, "(").append(")"))
                    .replace("3", e1.asString().insert(0, "(").append(")"))
                    .replace("4", variable.asString()));
        } catch (ParseException e2) {
            e2.printStackTrace();
        }
        return null;
    }

    public String replace(String e, String e1) {
        return expression.replace(e, e1);
    }
